import React from "react";
import "./User.css";

const User = ({ pic, name, status }) => {
  // const { pic, name, status } = user;
  return (
    <>
      <div className="user">
        <img src={pic} alt={name} />
        <div className="user-details">
          <p className="user-name">{name}</p>
          <p className="user-status">{status}</p>
        </div>
      </div>
    </>
  );
};

export default User;
